import React from 'react';

import { withRouter } from "react-router-dom";
import { connect } from "unistore/react";
import { actions } from "../store";

class ListDetailDestinasi extends React.Component {
    componentDidMount = () =>{
        const paramKota = this.props.match.params.kota
        this.props.kategoriKota(paramKota)
    }
    render() {
        return (
            <React.Fragment>
                <div className="row"><span style={{color:"white"}}> a </span></div>
                    <div style={{textAlign:"center", borderBottom:"2px solid black"}}>
                        <h1>{this.props.idKota}</h1>
                        <span>{this.props.listHasilTriposo.snippet}
                        </span>
                        <div className="row"><span style={{color:"white"}}> a </span></div>
                    </div>
                    <div className="row"><span style={{color:"white"}}> a </span></div>
                <div className="container destinasi-list-destinasi" >
                    <div className="row ">
                    {this.props.listDestinasi.map((isi,i)=>(
                    <React.Fragment>
                        <div className="col-md-4 col-sm-12" style={{border:"1px solid black", margin:"10px 0px 10px 0px", borderRadius:"10%"}}>
                            <div >
                                <img src={isi.sizes.original.url} style={{width:"100%", 
                                height:"100%", marginTop:"10px", borderRadius:"10%"}} alt=""/>
                                <h5 style={{paddingTop:"10px"}}>{isi.caption}</h5>
                            </div>
                        </div>
                    </React.Fragment>
                    ))}
                    </div>
                </div>
            </React.Fragment>
        )
    }
};

export default connect("listDestinasi, listHasilTriposo, idKota, isLoading", actions)(withRouter(ListDetailDestinasi));
